import React, { useState, useEffect } from "react";
import SensorEventsItem from "./SensorEventsItem";
import { getSensorsEvent } from "./SensorEventsService";


const SensorEvents = () => {
  const [sensorsEvents, setSensorsEvents] = useState([]);
  
  const loadSensorEvents = async () => {
    let resp = await getSensorsEvent(),
    datas = [],
    valu = [],
    i = 0;
    for (datas[i++] in resp) {
      let lastItem = datas.length - 1;
      valu.push(resp[datas[lastItem]]);
    }
    const res = valu[0].data
    console.log('res:', res)
    setSensorsEvents(res);
  };
  
  const { data } = sensorsEvents;
  let dat = data,
    datas = [],
    values = [],
    i = 0;
  for (datas[i++] in dat) {
    let lastItem = datas.length - 1;
    values.push(dat[datas[lastItem]]);
  }

  useEffect(() => {
    loadSensorEvents();
  }, []);

  return (
    <div className="container d-flex justify-content-center">
      <div className="row align-items-start">
        <div className="row d-flex">
          <br />
          {values.map((sensorEvents) => {
            
            return <SensorEventsItem sensorEvents={sensorEvents} key={sensorEvents._Id} loadSensorEvents={loadSensorEvents}/>;
          })}
        </div>
      </div>
    </div>
  );
};

export default SensorEvents;
